import React from 'react'
import Data from './Data'

class MaineContent extends React.Component {
    constructor(){
        super()
        this.state={
            data: Data.map(items =>
                <div className="card-group">
                    <div className="card">
                        <img src={items.linkImage} className="card-img-top" style={{width:"250px"}} alt="..."/>
                            <div className="card-body">
                                <h5 className="card-title">Card title</h5>
                                <p className="card-text">This is a longer card with supporting text below as a natural
                                    lead-in to additional content. This content is a little bit longer.</p>
                                <p className="card-text">
                                    <small className="text-muted">Last updated 3 mins ago</small>
                                </p>
                            </div>
                    </div>
                </div>)
        }
    }

    render() {
     return(
         <div className="row">
             {this.state.data}
         </div>
        )
    }

}

export default MaineContent
